/*
@author: Eligijus Skersonas
*/

import React, { Component } from "react";

class Features extends Component {
  state = {
    count: 0,
    yearBuilt: 1969,
    taxAmount: 4542.86,
    noOfBathrooms: 2,
    noOfBedrooms: 3,
    area: 1476,
  };

  centreContent = {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  };

  render() {
    return (
      <React.Fragment className="bg-primary">
        {this.renderForm()}
      </React.Fragment>
    );
  }

  renderForm() {
    const margin = "m-4";

    return (
      <form>
        <div class="row align-items-center">
          <div class="col-auto">
            <input
              type="text"
              class="form-control mb-2"
              id="inlineFormInput"
              placeholder="Name"
            />
          </div>
          <div class="col-auto">
            <div class="input-group mb-2">
              <input
                type="text"
                class="form-control"
                id="inlineFormInputGroup"
                placeholder="Username"
              />
            </div>
          </div>
          <div class="col-auto">
            <div class="form-check mb-2">
              <input
                class="form-check-input"
                type="checkbox"
                id="autoSizingCheck"
              />
              <label class="form-check-label" for="autoSizingCheck">
                Remember me
              </label>
            </div>
          </div>
          <div class="col-auto">
            <button type="submit" class="btn btn-primary mb-2">
              Submit
            </button>
          </div>
        </div>
      </form>
    );
  }
}

export default Features;
